import React, { useState, useEffect } from "react";
import axios from "axios";
import CoinComponent from "./coinComponent";

const CoinFeed = () => {
    const [data, setData] = useState({ coins: [] });
  useEffect(() => {
    const fetchData = async () => {
      const result = await axios("http://localhost:8000/coins");
      setData(result.data.data.coins);
      console.log(result.data.data);
    };

    fetchData();
  }, []);
  return (
      <div>
          {
      data.map((coin, index) => {
        return <CoinComponent key={index} news={coin}></CoinComponent>
      })
    }
    </div>
  )
}

export default CoinFeed;
